import "./App.css";
import { TwoC, TwoD, TwoH, TwoS } from "./react_cards";

function App() {
  return (
    <div className="App">
      <div className="hand hhand-compact active-hand">
        <TwoC />
        <TwoD />
        <TwoH />
        <TwoS />
      </div>
    </div>
  );
}

export default App;
